const raw = $json.output || "";

// ```json ... ``` entfernen
let clean = raw.trim()
  .replace(/^```json\s*/i, "")
  .replace(/```$/i, "")
  .trim();

let parsed;
try {
  parsed = JSON.parse(clean);
} catch (e) {
  return [{ json: { error: "Fehler beim Parsen", raw: clean } }];
}

// Nur match & merged_version_created zur√ºckgeben
return [{
  json: {
    match: parsed.match,
    merged_version_created: parsed.merged_version_created 
  }
}];

